description.text:
First print the Moon Lithopane, with preferably white filament, finishing off the last layer with black filament - using the filament-switch method.  
Then print the MoonPhaseDivider.  
Populate the divider with 3mm white (or any preferred color) LEDs.<br />
Each pair within each division should be wired in parallel.  
To power the LEDs, I used a Texas Instruments TLC5940 16 channel PWM LED Controller.  To control the TLC5940 I used an Arduino Pro Mini clone.  For timekeeping, a DS1307 or DS3231 is ideal - I use DS3231's...  with the DS3231's killer accuracy, once set, I figure I may never need to set it again, so I didn't use any Human Interface Device.  
certainly, any LED control chip can be used, or Charlieplexing would work too, albeit somewhat dimly.  Additionally, if you will be able to keep it PC connected, you could also forego using a Real Time Clock Module, and get time from your PC with numerous methods out there.  
Leaving out the Real Time Clock - related code, here is the meat of the sketch I used:  
